  true,\n\t\"url\": null,\n\t\"notes\": \"GLA12 contains the ice sheet elevation and
  elevation distribution corrected for geodetic and atmospheric affects calculated
  from algorithms fine-tuned for ice sheet returns. Data granules contain 14 orbits
  of data within the ice sheet mask. (Suggested Usage: The purpose of this file is
  to provide ice sheet elevation and elevation distribution calculated from algorithms
  fine-tuned for ice sheet returns to the research user community. It will also include
  the laser footprint geolocation, reflectance, and the geodetic, instrument, and
  atmospheric corrections used to correct the range measurements. Parameters will
  be at the full 40 per second resolution, but only for locations that fall within
  the ICESat ice sheet mask.)\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
